// Libs
import React from 'react';
import styled from 'styled-components';

// Styles
const Container = styled.div`
  width: 100%;
  height: 4rem;
  display: flex;
  justify-content: center;
  background: red;
`;

const Content = styled.div`
  width: 95%;
  height: 4rem;
  background: green;
  border-radius: 1px solid #e7e9eb;
`;

const Header = () => {
  return (
    <Container>
      <Content>

      </Content>
    </Container>
  )
};

export default Header;
